import './App.css';
import Planet from './Components/Planet/planet.js'; 
function App() {
  return (
    <div className="App">
      <h1>Cosmos Oddysey</h1>
      <p>Select your origin planet, fellow alien!</p>
      <div className="planet-container">
        <Planet planet="Mercury" />
        <Planet planet="Venus" />
        <Planet planet="Earth" />
        <Planet planet="Mars" />
        <Planet planet="Jupiter" />
        <Planet planet="Saturn" />
        <Planet planet="Uranus" />
        <Planet planet="Neptune" />
      </div>
    </div>
  );
}

export default App;
